import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getCategories } from "../../action/CategoryAction";


const CategoryPage = () => {
    let [titleOfCategory, setTitle] = useState('')
    const dispatch = useDispatch()
    const categorySelector = useSelector(state => state.Category)

    useEffect( () => {
        dispatch(getCategories())
    }, [dispatch])
    let category = categorySelector.categories
    if (category === undefined) {
        category = []
    }
    else {
        return (
            <>
                {category.map( (categor) => 
                    <div>{categor.title}</div>
                )}
            </>
        )
    }
}

export default CategoryPage
